sources.styles\\blocks\\_card.scss:
.card {
  display: flex;
  flex-direction: column;
  align-items: center;

  &__photo {
    margin-bottom: 16px;
    width: 288px;
    height: 356px;
    border-radius: 8px;
    transition: transform 0.3s;

    &:hover {
      transform: scale(103%);
    }
  }

  &__content {
    width: 288px;
  }

  &__name {
    margin-bottom: 8px;

    font-weight: 500;
    line-height: 16px;
    letter-spacing: 0.02em;
    text-transform: uppercase;
    color: $main-grey;
  }

  &__description {
    margin-bottom: 16px;
    font-size: 16px;
    font-weight: 500;
    line-height: 24px;
    letter-spacing: -0.01em;
    color: $main-black;
  }

  &__button {
    display: flex;
    justify-content: start;
    align-items: center;
    gap: 8px;

    box-sizing: border-box;
    width: 84px;
    height: 32px;
    text-decoration: none;

    border-bottom: 1px solid transparent;
    transition: border-bottom 0.3s;

    &-arrow {
      width: 16px;
