sources.styles\\blocks\\_statistic.scss:
.statistic {
  background-image: url(../images/Crumbs.png);
  background-repeat: no-repeat;
  background-size: auto 276px;
  background-position-y: 40%;
  background-position-x: center;

  @include onTablet {
    background-image: none;
    display: grid;
    grid-template-columns: repeat(8, 1fr);
    column-gap: 24px;
  }

  &__item {
    margin-bottom: 48px;

    &:last-child {
      margin-bottom: 72px;
    }

    @include onTablet {
      margin-bottom: 80px;

      &--1 {
        grid-column: 1/4;
      }

      &--2 {
        grid-column: 5/9;
      }

      &--3 {
        grid-column: 1/4;
      }

      &--4 {
        grid-column: 5/9;
      }

      &:last-child {
        margin-bottom: 152px;
      }
    }

    @include onLaptop {
      margin-bottom: 349px;

      &--1 {
        grid-column: 1/3;
      }

      &--2 {
        grid-column: 3/4;
      }

      &--3 {
        grid-column: 5/7;
      }

      &--4 {
        grid-column: 7/9;
      }
    }
  }

  &__number {
    margin-bottom: 8px;
    font-size: 96px;
    line-height: 82px;
    letter-spacing: -0.05em;
    text-transform: uppercase;
    color: $main-black;
  }

  &__text {
    font-size: 16px;
    line-height: 24px;
    letter-spacing: -0.01em;
    color: $main-grey;
  }
}

sources.styles\\blocks\\_footer.scss:
.footer {
  padding: 61px 16px 56px;
  background-color: $main-black;
  color: $main-white;

  &__first-part {
    margin-bottom: 64px;
  }

  &__logo-img {
    margin-bottom: 45px;
    padding: 0 5px;
  }

  &__title {
    margin-bottom: 16px;
    font-weight: bold;
    font-size: 16px;
    line-height: 16px;
    letter-spacing: 0.02em;
    text-transform: uppercase;
    color: $main-grey;
  }

  &__link {
    display: block;
    margin-bottom: 16px;
    text-decoration: none;
    font-size: 16px;
    line-height: 24px;
    letter-spacing: -0.01em;
    color: $main-white;
    transition: color 0.3s;

    &:hover {
      color: $main-orange;
    }

    &:last-child {
      margin-bottom: 44px;
    }
  }

  &__contact {
    margin-bottom: 40px;
    width: 248px;
    font-weight: 400;
    font-size: 48px;
    line-height: 41px;
    letter-spacing: -0.05em;
    text-transform: uppercase;
    color: $main-white;
  }

  &__contact-3 {
    margin-bottom: 40px;
  }

  &__email {
    display: block;
    margin-bottom: 42px;
    font-size: 16px;
    line-height: 24px;
    letter-spacing: -0.01em;
    color: $main-white;
    text-decoration: none;

    transition: color 0.3s;

    &:hover {
      color: $main-orange;
    }
  }

  &__social {
    margin-bottom: 42px;

    &--icon-facebook {
      margin-left: 7px;
    }

    &--icon-instagram {
      margin-left: 24px;
    }

    &--icon-twitter {
      margin-left: 30px;
    }
  }

  &__icon {
    text-decoration: none;
    fill: $main-orange;
    transition: fill 0.3s;

    &:hover {
      stroke: $main-white;
      fill: $main-white;
    }
  }

  &__copyright {
    font-size: 16px;
    line-height: 24px;
    letter-spacing: -0.01em;
    color: $main-grey;
  }

  @include onTablet {
    & {
      display: grid;
      grid-template-columns: repeat(8, 1fr);
      column-gap: 24px;
      padding: 88px 44px;

      &__first-part {
        grid-column: 1/5;
        margin-bottom: 0;
      }

      &__second-part {
        grid-column: 5/9;
        margin-bottom: 48px;
      }

      &__link {
        &:last-child {
          margin-bottom: 40px;
        }
      }

      &__logo-img {
        margin-bottom: 101px;
      }

      &__contact {
        width: 248px;
        font-size: 56px;
        line-height: 48px;
      }

      &__email {
        display: block;
        margin-bottom: 0;
      }

      &__social {
        display: flex;
        grid-column: 1/3;
        margin-bottom: 0;
      }

      &__copyright {
        grid-column: 5/9;
      }
    }
  }

  @include onLaptop {
    & {
      padding: 88px 49px;

      &__first-part {
        margin-bottom: 50px;
      }

      &__second-part {
        margin-bottom: 0;
      }

      &__link {
        &:last-child {
          margin-bottom: 0;
        }
      }

      &__logo-img {
        margin-bottom: 66px;
      }

      &__contact {
        width: 496px;
        font-size: 72px;
        line-height: 61px;

        &-container {
          display: grid;
          grid-template-columns: repeat(4, 1fr);
        }

        &-1 {
          grid-column: 1/3;
        }

        &-2 {
          grid-column: 3/5;
        }
      }

      &__contact-3 {
        margin-bottom: 0;
      }
    }
  }

  @include onDesktop {
    & {
      padding: 88px 129px;
    }
  }
}
